// ==UserScript==
// @name         extrem-download Direct Link
// @name:en      extrem-download Direct Link
// @namespace    https://extrem-download.co/
// @version      1.05
// @description  Show direct link on extre-download !
// @description:en  Show direct in extrem-download!
// @author       Thibault
// @icon data:image/jpeg;base64,
// @include /http(|s)://(|.*\.)extreme-download(||1|2|3|4|5|6|7|8|9).(|ws|com|org|net|ninja|co|xyz)/.*/
// @include /http(|s)://(|.*\.)extreme-down(||1|2|3|4|5|6|7|8|9).(|ws|com|org|net|ninja|co|xyz)/.*/
// @include /http(|s)://(|.*\.)ed-protect(||1|2|3|4|5|6|7|8|9).(|ws|com|org|net|ninja|co|xyz)/.*/
// @require      http://code.jquery.com/jquery-latest.js
// @grant       none
// @downloadURL https://update.greasyfork.org/scripts/390087/extrem-download%20Direct%20Link.user.js
// @updateURL https://update.greasyfork.org/scripts/390087/extrem-download%20Direct%20Link.meta.js
// ==/UserScript==
var $head = $('head');

$head.append($('<link rel="stylesheet" href="//maxcdn.bootstrapcdn.com/font-awesome/4.7.0/css/font-awesome.min.css">'));


(function() {
    $(document).ready(function() {
        function bindEvent(element, eventName, eventHandler) {
            if (element.addEventListener){
                element.addEventListener(eventName, eventHandler, false);
            } else if (element.attachEvent) {
                element.attachEvent('on' + eventName, eventHandler);
            }
        }

        function copyToClipboard(text) {
            var dummy = document.createElement("textarea");
            document.body.appendChild(dummy);
            dummy.value = text;
            dummy.select();
            document.execCommand("copy");
            document.body.removeChild(dummy);
        }

        if(location.href.indexOf("extreme-download.co/torrent/") >= 0 || location.href.indexOf("extreme-down.xyz/torrent/") >= 0 )
        {
            if($("a[href*='//ed-protect.org']").length > 0)
            {
                $link =$("a[href*='://ed-protect.org']")[0];
                $($link).attr('href',$($link).attr('href').replace('http','https'));
                if ($( window.parent.document).find("#my_frame").length > 0)
                {
                    $($link).attr('target', 'my_frame');
                }
                else
                {
                    $($link).attr('target', '_self');
                }


            }
        }
        else if(location.href.indexOf("ed-protect.org") >= 0 )
        {
            if ($(".contenu_captcha #submit_button").length > 0)
            {
                $(".contenu_captcha #submit_button").click();
            }
            else if($(".affichier_lien .lien a").length > 0)
            {
                getUrl = "";
                linkArray = 0;
                tbUrl=[];
                var postUrl = location.ancestorOrigins[0];
                $(".affichier_lien tr").each(function()
                {
                    if( $(this).find(".all_liens a").attr("href") != undefined)
                    {
                        tbUrl[linkArray] =[];
                        tbUrl[linkArray]["url"] =  $(this).find(".all_liens a").attr("href")
                        tbUrl[linkArray]["status"] =  $(this).find("img:first").attr("src");
                        tbUrl[linkArray]["name"] =  $(this).find("td:first div>span").html();
                        //getUrl += $(this).attr("href")+" <br> ";
                        linkArray++;
                    }
                });
                //tbUrl[0] = getUrl;
                //tbUrl[1] = "/"+$(".affichier_lien img").attr("src");
                parent.window.postMessage(tbUrl, postUrl);
            }

        }
        else{
            formId = 0;
            $("a[href^='/torrent/']").each(function (index) {
                $(this).attr('linkRef', 'form-link-' + formId);
                $(this).after('<button type="button" class="btn-analyser " style=" background-color: #2fdf2f;  border-color: #2fdf2f;" data-id="' + formId + '" id="form-analyser-' + formId + '" > <img src="data:image/png;base64," style="width:14px"> </button>'+' <button type="button" id="form-copy-' + formId + '" class="copyUrl" style="display:none; background-color: cornflowerblue;border-color: cornflowerblue;" data-title="Copier le lien" data-clipboard-text=""> Copy all <img src="data:image/png;base64," style="width:14px"> </button> <div id="urlDecode-' + formId + '" class="urlDecode"></div>');
                formId++;
            });

            $("a[href*='//ed-protect.org/']").each(function (index) {
                if ($(this).find(".hebergeur").html() != "Usenet")
                {
                $(this).attr('linkRef', 'form-link-' + formId);
                $(this).after('<button type="button" class="btn-analyser " style=" background-color: #2fdf2f;  border-color: #2fdf2f;" data-id="' + formId + '" id="form-analyser-' + formId + '" > <img src="data:image/png;base64," style="width:14px"> </button>'+' <button type="button" id="form-copy-' + formId + '" class="copyUrl" style="display:none; background-color: cornflowerblue;border-color: cornflowerblue;" data-title="Copier le lien" data-clipboard-text=""> Copy all <img src="data:image/png;base64," style="width:14px"> </button> <div id="urlDecode-' + formId + '" class="urlDecode"></div>');
                formId++;
                }
            });
            $(".urlDecode").hide();
            $("body").append("<div><iframe id='my_frame' name='my_frame' src='about:blank' style='width:0px; height:0px'></iframe></div>");
            $('.blockcontent').on('click', '.btn-analyser', function (e)
            {
                e.preventDefault();
                e.stopPropagation();
                id = $(this).attr("data-id");
                $('[id^="urlDecode-"] .spinner').hide();
                $("#urlDecode-"+id).show();
                $("#urlDecode-"+id).html('<img alt="" class="spinner" src="data:image/svg+xml;base64," style="width:24px"/>');

                $('#dl-protect').attr('data-id', id);
                $('[linkRef=form-link-' + id +']').attr('target', 'my_frame');
                $('[linkRef=form-link-' + id +']')[0].click();
                $('[linkRef=form-link-' + id +']').attr('target', '_blank');


                bindEvent(window, 'message', function (e) {
                    if (e.origin == "https://ed-protect.org" ||e.origin == "http://ed-protect.org")
                    {
                        href="";
                        hrefStatus="";
                        for (var i = 0; i < e.data.length; i++)
                        {
                            href += e.data[i]["url"]+" ";
                            if (i ==0)
                            {
                                hrefStatus += "<br/>";
                            }
                            hrefStatus += "<a href='"+e.data[i]["url"]+"' title='"+e.data[i]["name"]+"' style='color:#0769ad' >"+e.data[i]["url"]+"</a>"+" "+" <img src='"+e.origin+'/'+e.data[i]["status"]+"'><button type='button' class='copyUrl' style='background-color: cornflowerblue;border-color: cornflowerblue;' data-title='Copier le lien' data-clipboard-text="+e.data[i]["url"]+"> <img src='data:image/png;base64,' style='width:14px'> </button><br/>";
                        }

                        //$("#urlDecode-"+id).attr("href",href);
                        $("#urlDecode-"+id).html(hrefStatus);
                        $("#form-copy-"+id).attr("data-clipboard-text", href.trim());
                        $("#form-copy-"+id).show();
                    }
                });
            })

            $('.blockcontent').on('click', '.copyUrl', function ()
                              {
                copyToClipboard($(this).attr("data-clipboard-text"));
            })
        }
    });
})();
